import React from 'react';
import './styles.css';

const Contacts = () => {
  return (
    <div className="contacts">
      <h1>Contacto</h1>
      <p>Ponte en contacto con nosotros a través de este formulario.</p>
    </div>
  );
};

export default Contacts;
